
export default class MyClass {
	instancePropertyBefore = 'Default 1';
	constructor(){
		this.instancePropertyBefore = 'Overriden 1';
		this.instancePropertyAfter = 'Overriden 2';
	}
	instancePropertyAfter = 'Default 2';
	boundArrow = myvalue => myvalue + this.instancePropertyAfter;
	boundFunction = function(myvalue){
		return myvalue + this.instancePropertyAfter;
	};

	static staticProperty = 'My Static Value';
	static staticArrow = myvalue => myvalue + MyClass.staticProperty;
	static staticFunction = function(myvalue){
		return myvalue + MyClass.staticProperty;
	};
}
